import { useState } from "react";
import { FaSistrix } from "react-icons/fa";
import './ChatList.css';

function ChatList(){

    const [chats, setChats] = useState([{
        name:"Tom",
        age: 16,
        color:"purple",
        id:1
    },
    {
        name:"Kim",
        age: 17,
        color:"black",
        id:2
    }])

    return(
        <div style={{border:"5px solid black", paddingBottom: "800px"}}>
            <div className="search-input-div">
                <input type="text" className="search-input"></input>
                <FaSistrix className="search-input-icon"/>
            </div>
            
            


            {
                chats.map((chat, id) => ( 
                <div key={id} style={{marginTop:20, marginBottom:20}}>
                    <p>{chat.name}</p>
                </div>
                
                ))
            
            } 

        </div>
    )
}

export default ChatList;
